INSERT INTO `tb_foods` (`id`, `nama`, `stok`, `image`, `deskripsi`, `category_id`) VALUES
(2, 'Capcay', 25, , 'Capcay (pinyin: zasui) adalah dialek Hokkian yang berarti harfiah “aneka ragam sayur”. Capcay adalah nama hidangan khas Tionghoa yang populer yang khas karena dimasak dari banyak macam sayuran. Jumlah sayuran tidak tentu, namun banyak yang salah kaprah mengira bahwa capcai harus mengandung 10 macam sayuran karena secara harfiah adalah berarti “sepuluh sayur”. Cap di dalam dialek Hokkian juga berarti sepuluh dan Cay artinya sayur.', 1);
INSERT INTO `tb_foods` (`id`, `nama`, `stok`, `image`, `deskripsi`, `category_id`) VALUES
(3, 'Kerang', 10, , 'semua moluska dengan sepasang cangkang (lihat Bivalvia). Dengan pengertian ini, lebih tepat orang menyebutnya kerang-kerangan dan sepadan dengan arti clam yang dipakai di Amerika. Contoh pemakaian seperti ini dapat dilihat pada istilah \"kerajinan dari kerang\".', 1);
INSERT INTO `tb_foods` (`id`, `nama`, `stok`, `image`, `deskripsi`, `category_id`) VALUES
(4, 'Gorengan', 15, , 'adalah makanan ringan yang populer. Penjual gorengan dapat ditemukan di tepi jalan atau berkeliling dengan pikulan atau gerobak. Bahan-bahan yang dilapis adonan tepung dan digoreng antara lain; pisang, tempe, tahu, oncom, ubi, singkong, cireng (Bahasa Sunda: Aci digoreng), yaitu tepung singkong digoreng, sukun, dan bakwan (di Jawa Barat disebut \"bala-bala\") yaitu adonan tepung yang dicampur cacahan kubis dan wortel. Salah satu jenis gorengan yang populer adalah Tahu Sumedang. Perkedel jagung dan perkedel kentang juga masuk dalam kategori gorengan. Gorengan biasanya dimakan dengan cabe rawit. Di Malaysia gorengan juga lazim ditemui, antara lain pisang goreng dan ubi goreng.', 2);
INSERT INTO `tb_foods` (`id`, `nama`, `stok`, `image`, `deskripsi`, `category_id`) VALUES
(5, 'Telur Dadar', 30, , 'Telur dadar atau omelet adalah variasi hidangan telur goreng yang disiapkan dengan cara mengocok telur dan menggorengnya dengan minyak goreng atau mentega panas di sebuah wajan. ', 2);
INSERT INTO `tb_foods` (`id`, `nama`, `stok`, `image`, `deskripsi`, `category_id`) VALUES
(6, 'Ikan Tongkol', 18, , 'Ikan Tongkol adalah sejenis ikan laut dari suku Scombridae. Terutama menjelajah di perairan dangkal dekat pesisir di kawasan Indo-Pasifik Barat, tongkol merupakan salah satu jenis ikan tangkapan yang penting bagi nelayan. Dalam perdagangan internasional dikenal sebagai kawakawa, little tuna, mackerel tuna, atau false albacore. ', 1);
INSERT INTO `tb_foods` (`id`, `nama`, `stok`, `image`, `deskripsi`, `category_id`) VALUES
(7, 'Semur Tahu', 16, , 'Semur Tahu adalah hidangan daging rebus dari Indonesia yang diolah dalam kuah berwarna coklat pekat yang terbuat dari kecap manis, bawang merah, bawang bombay, pala dan cengkih. Kecap manis yang terbuat dari kedelai hitam adalah bahan paling penting dalam proses pembuatan semur karena berfungsi untuk menguatkan cita rasa, tetapi harus tetap terasa menyatu harmonis dengan bahan-bahan lainnya. Selain berbahan utama daging sapi dan kentang, semur juga berdiri dari bermacam-macam variasi dalam penyajiannya, seperti penambahan tahu, tempe, telur, ikan, dan bahan lain-lain sesuai dengan selera masyarakat di daerah masing-masing. ', 1);
INSERT INTO `tb_foods` (`id`, `nama`, `stok`, `image`, `deskripsi`, `category_id`) VALUES
(8, 'Ayam Goreng', 25, , 'Ayam Goreng adalah hidangan yang dibuat dari daging ayam dicampur tepung bumbu yang digoreng dalam minyak goreng panas. Beberapa rumah makan siap saji secara khusus menghidangkan ayam goreng, misalnya Kentucky Fried Chicken. Sementara itu beberapa rumah makan di Indonesia juga menghidangkan ayam goreng tradisional Indonesia seperti Ayam Goreng Suharti, Fatmawati dan Mbok Berek. ', 2);
INSERT INTO `tb_foods` (`id`, `nama`, `stok`, `image`, `deskripsi`, `category_id`) VALUES
(9, 'Kentang Balado', 13, , 'Kentang adalah tanaman dari suku Solanaceae yang memiliki umbi batang yang dapat dimakan dan disebut \"kentang\" pula. Umbi kentang sekarang telah menjadi salah satu makanan pokok penting di Eropa walaupun pada awalnya didatangkan dari Amerika Selatan. ', 2);

